import React from 'react'
import { Container, Grid, Typography } from '@mui/material'

function Login() {
  return (
    <Container component='main' maxWidth='xs' style={{ marginTop: '8%' }}>
      <Grid item xs={12}>
        <Typography component='h1' variant='h5'></Typography>
      </Grid>
    </Container>
  )
}

export default Login
